    <button 
      type="button" 
      onClick={() => setOpenUserTab(false)} 
      className="btn btn-light btn-block w-100 mt-5"
      >Close</button>

    <div className="w-100 mt-5 pt-5">
    Chats
    </div>
  </div>
  )
}

export default Chat;
